Use this prop when you need to change the [default class
names](defaultClassNames.mdx) — for example when using CSS modules.

**Example**. Use of custom class names for the head and the caption
elements:

```jsx preview
 function App() {
   const css = `
     .salmon-head {
       color: salmon;
     }
     .purple-caption {
       font-weight: bold;
       color: purple;
       padding: 3px 0 6px 0;
     }
   `;
   return (
     <>
       <style>{css}</style>
       <DayPicker
         classNames={{
           head: 'salmon-head',
           caption: 'purple-caption'
         }}
       />
     </>
   );
 }
```

To select a day:

```jsx
function App() {
return (
 <DayPicker
   initialMonth={new Date(2020, 8)}
   selected={[
     new Date(2020, 8, 1),
     new Date(2020, 8, 19),
     new Date(2020, 8, 21),
     { after: new Date(2020, 8, 30), before: new Date(2020, 10, 1) }
   ]}
 />
);
```

#### Usage

Use this helper when swizzling the caption using the
[[DayPickerProps.components]] prop.

```jsx
function MonthCaption({ dayPickerProps }): JSX.Element {
  const { containerProps } = getCaptionProps(dayPickerProps);
  return (
    <caption {...containerProps}>
      Something inside the caption
    </caption>;
  )
}
<DayPicker components={{ MonthCaption }} />
```

